window.bookSummaryJSON = "<p><b>Lux Blakely, the preteen son of a NASA scientist working on top-secret government projects, is not shackled by accepted scientific theory and dogma.</b></p> <p>His experiments in gravimetric research and the expanding capability of a nascent AI cause Lux to be closely observed by several government agencies. He discovers a way to use magnetic fields for propulsion, but he needs money. Lux and his friend, Prissy, come up with a way to use his father's developing AI to raise money through social media. Lux is trying to get out of high school and into college at age nine. Lux and Prissy take deepfake videos to a whole new level and make a lot of money doing it. The US military and intelligence community is not amused.</p>"; 
